import * as React from "react";
import PropTypes from "prop-types";
import SwipeableViews from "react-swipeable-views";
import { useTheme } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { TextField } from "@mui/material";
import { Button } from "@mui/material";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired
};

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    "aria-controls": `full-width-tabpanel-${index}`
  };
}

export default function FullWidthTabs() {
  const theme = useTheme();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChangeIndex = (index) => {
    setValue(index);
  };
  const handleInputChange = (evento) => {
    console.log(evento.target.value);
  };

  return (
    <Box sx={{ bgcolor: "background.paper", width: '100%' }}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="secondary"
          textColor="inherit"
          variant="fullWidth"
          aria-label="full width tabs example"
        >
          <Tab label="Itens do Frete" {...a11yProps(0)} />
          <Tab label="Notas Fiscais" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === "rtl" ? "x-reverse" : "x"}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
          <TextField
            sx={{ m: 1, width: "30%" }}
            onChange={handleInputChange}
            required
            id="outlined-number"
            label="Total Vomule"
            type="number"
            InputLabelProps={{
              shrink: true
            }}
          />
          <TextField
            sx={{ m: 1, width: "30%" }}
            onChange={handleInputChange}
            required
            id="outlined-number"
            label="Total Cubagem"
            type="number"
            InputLabelProps={{
              shrink: true
            }}
          />
          <TextField
            sx={{ m: 1, width: "30%" }}
            onChange={handleInputChange}
            required
            id="outlined-number"
            label="Total Peso Real"
            type="number"
            InputLabelProps={{
              shrink: true
            }}
          />
          <TextField sx={{ m: 1,width:'12%'}}onChange={handleInputChange} required id="outlined-required" label="Cód Frete"/>
          <TextField sx={{width:'30%'}}onChange={handleInputChange} required id="outlined-required" label="Descrição da Carga"/>
          <Button sx={{width:'8%'}} variant="outlined">Buscar</Button>
          <TextField sx={{ m: 1, width: "30%" }}onChange={handleInputChange}requiredid="outlined-number"label="Qtd Vol"type="number"InputLabelProps={{shrink: true}}/>
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
          Item Two
        </TabPanel>
      </SwipeableViews>
    </Box>
  );
}
